import Navbar from "./components/navbar"
import Footer from "./components/footer"
import 'bulma/css/bulma.css'
// import { fetchAPI } from './API';
function App() {

  const prueba = "prueba"
  const [response, setResponse] = useState(prueba);

  const API_URL = 'http://localhost:3000'

   function fetchAPI() {
    fetch(`${API_URL}/api/testAPI`)
      .then((data) => {
        console.log(data);
        console.log("parsing")
        return data.json();
      })
      .then((response) => {
        console.log(response);
        // setResponse(response);
      })
  }
  // eslint-disable-next-line react-hooks/exhaustive-deps
  // const callAPI = async () => {
  //   const response = await fetchAPI();
  //   console.log(response);
  // };

  useEffect(() => {
    fetchAPI();
  }, [])

  return (
    <div className="App">
      <Navbar />       
      <p>{response}</p>
      <Footer/>
    </div>
  );
}

export default App;
